export function add47(a: number, b: number): number {
  return a + b;
}

export function subtract47(a: number, b: number): number {
  return a - b;
}

export function multiply47(a: number, b: number): number {
  return a * b;
}

export function divide47(a: number, b: number): number {
  return a / b;
}
